function detaildata() {
  //传原子序数(string)，加a表示获取位置
  var elem = tapElem
  console.log(elem.concat('号元素'))
  console.log(elemlist[elem][1][1])
  for(var i=1;i<elemlist.length;i++){
    if(elem==elemlist[i][1][4]){
      var position = elemlist[i][2][0][1].split("-", 2)
      var group = position[0].toLowerCase()
      //var viialist = ['','','','','','']
      if(group=="0"){group = "o"}
      else if(group=="viii" || group=="iiib" && parseInt(elemlist[i][1][4]) > 39){
        group = elemlist[i][2][0][2]
      }
      //表格中的位置
      var period = parseInt(position[1])
      //镧系，锕系位置修正
      if(period==6){
        if(elem>=57 && elem <72){
          period = 9
        }
      }else if(period==7){
        if(elem>=89 && elem <104){
          period =10
        }
      }else if(period==8){
        if(elem>=121 && elem<136){
          period =11
        }
      }

      console.log('周期'.concat(period))
      console.log('族'.concat(group))
      console.log('signColor:'.concat(tabledata[period - 1][group][4]))
      //原子量
      elemlist[i][1][6] = tabledata[period - 1][group][3]
      //标签色
      elemlist[i][1][7] = signColor[tabledata[period - 1][group][4]]
      break
    }
  }
  return elemlist[i]
}


